            scottradeHighlight2Path.fill()

            context.endTransparencyLayer()
            context.endTransparencyLayer()
            NSGraphicsContext.restoreGraphicsState()



            context.endTransparencyLayer()

            NSGraphicsContext.restoreGraphicsState()
        }


        if (pressed) {
